import React from "react";
import Logo from "../../../components/Logo";
import { Link } from "react-scroll";
import sun from "../../../public/assets/icons/sun.png";
import kodyHead from '../../../public/assets/Kody/head.png'

const Navbar = () => {
  return (
    <>
      <nav className="bg-gray-700 my-5 mx-10 px-6 py-2 rounded-lg flex items-center justify-between">
        <Logo />
        <div className="flex gap-6 text-green-500">
          <Link
            to="Home"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer duration-300 transition-all"
          >
            Home
          </Link>
          <Link
            to="why"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer duration-300 transition-all"
          >
            Why Kode?
          </Link>
          <Link
            to="kody"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer duration-300 transition-all"
          >
            Meet Kody
          </Link>
          <Link
            to="works"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer duration-300 transition-all"
          >
            How it works?
          </Link>
          <Link
            to="pricing"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer  duration-300 transition-all"
          >
            Pricing
          </Link>
          <Link
            to="contact"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            className="hover:text-green-300 cursor-pointer duration-300 transition-all"
          >
            Contact Us
          </Link>
        </div>
        <div className="flex items-center gap-4">
          <button className="bg-green-600 px-3 py-1 rounded-lg hover:bg-green-300 hover:text-gray-700 duration-300 transition-all">
            Sign in
          </button>
          <div className="w-[2em] h-[2em] border-2 border-green-600 rounded-lg flex items-center justify-center">
            <img src={sun} alt="Light mode" width={20} />
          </div>
        </div>
      </nav>
      <img src={kodyHead} />
    </>
  );
};

export default Navbar;
